    "valentine-national-wildlife-refuge-period-january-1-to-april-30-1943-narrative-report",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Valentine NWR
    outlines Refuge accomplishments from January through April of 1943. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and collections and receipts. Resource management
    is outlined; topics include grazing, fur harvesting, and timber removal. The public
    relations section of the report describes Refuge visitors. N-R forms and an annual
    summary are attached.",nt"license_title": "License Not Specified",nt"extras":
